import React from 'react';
import { Button as BootButton } from 'reactstrap';

const Button = ({ clickHandler, label, color }) => {
    return (
        <BootButton 
            color={color} 
            onClick={clickHandler}
            className='button'>
            {label}
        </BootButton>
    )
}

export default Button;
